import { Route, BrowserRouter as Router, Routes } from "react-router-dom";

import Login from "./Components/Authentication/Login";
import Signup from "./Components/Authentication/SignUp";
import Dashboard from "./Components/Home/Pages/Dashboard/Dashboard";
import SetProfile from "./Components/Home/Pages/ProfileComponents/SetProfile";
import EditUserQuestion from "./Components/Home/Pages/Question/EditUserQuestion";
import { EditIdProvider } from "./Components/Home/Providers/EditContext";

const App = () => {
  return (
    <div>
      <Router>
        <Routes>
          <Route path="/signup" element={<Signup />} />
          <Route path="/login" element={<Login />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/profile" element={<SetProfile />} />
          <Route path="/editQuestion" element={<EditUserQuestion />} />
        </Routes>
      </Router>

      <EditIdProvider>\
      </EditIdProvider>
    </div>
  );
};

export default App;
